import React from 'react'
import GoiCuon from '../assets/img/goi-cuon.png'
// import GoiBo from '../assets/img/goi-bo.'


const ProperImage = props => {
  switch(props.image){
    case 'goi-cuon':
        return <image src={GoiCuon} alt={props.image}/>
    default:
        console.error('not valid image string', `props.image: ${props.image}`)
  }
}

export default ProperImage
